// LeetCode-2602: https://leetcode.com/problems/minimum-operations-to-make-all-array-elements-equal/
// Straight-forward solution runs into TLE

#include <vector>
#include <climits>
#include <cassert>
#include <algorithm>

using namespace std;

class Solution {
private:
    inline long long findMinOperations(vector<int>& vec, int reqVal) {
        long long numOperations = 0;

        for (int i = 0; i < vec.size(); i++) {
            numOperations += abs(vec[i] - reqVal);
        }

        return numOperations;
    }

    vector<long long> buildPrefixSumVec(vector<int>& vec) {
        int len = vec.size();
        if (len == 0) {
            return {};
        }

        vector<long long> prefixSumVec(len);
        long long prefixSum = 0;
        for (int i = 0; i < len; i++) {
            prefixSum += vec[i];
            prefixSumVec[i] = prefixSum;
        }

        return prefixSumVec;
    }

    vector<long long> buildSuffixSumVec(vector<int>& vec) {
        int len = vec.size();
        if (len == 0) {
            return {};
        }

        vector<long long> suffixSumVec(len);
        long long suffixSum = 0;
        for (int i = len - 1; i >= 0; i--) {
            suffixSum += vec[i];
            suffixSumVec[i] = suffixSum;
        }

        return suffixSumVec;
    }

    inline int binSearchIdx(vector<int>& vec, int ele) {
        vector<int>::iterator it = lower_bound(vec.begin(), vec.end(), ele);
        return distance(vec.begin(), it);
    }

    inline long long calcMinOperations(
            vector<int>& vec,
            vector<long long>& prefixSum,
            vector<long long>& suffixSum,
            int reqVal) {
        int len = vec.size();

        int idx = binSearchIdx(vec, reqVal);
        int eleIdx = (idx < 0) ? INT_MIN : ((idx >= len) ? INT_MAX : vec[idx]);
        if (eleIdx == INT_MIN) {
            return abs(suffixSum[0] - (len * ((long long) reqVal)));
        } else if (eleIdx == INT_MAX) {
            return abs(prefixSum[len - 1] - (len * ((long long) reqVal)));
        } else {
            return abs((idx * ((long long) reqVal)) - ((idx >= 1) ? prefixSum[idx - 1] : 0))
                   + abs(suffixSum[idx] - (((long long) reqVal) * (len - idx)));
        }
    }

public:
    vector<long long> minOperations(vector<int>& nums, vector<int>& queries) {
        sort(nums.begin(), nums.end());

        int numQueries = queries.size();
        if (numQueries == 0) {
            return {};
        }
        vector<long long> minOperationsVec(numQueries);

        vector<long long> prefixSumVec = buildPrefixSumVec(nums);
        vector<long long> suffixSumVec = buildSuffixSumVec(nums);

        int i = 0;
        for (int reqVal: queries) {
            minOperationsVec[i++] = calcMinOperations(nums, prefixSumVec, suffixSumVec, reqVal);
        }

        return minOperationsVec;
    }
};

